import React from 'react';
import { YAxis as RechartsYAxis } from 'recharts';

const YAxis = ({ dataKey = 'defaultKey', ...rest }) => {
  return <RechartsYAxis dataKey={dataKey} {...rest} />;
};

export default YAxis;
